SELECT DISTINCT ?player ?playerName ?birthplace ?birthplaceName WHERE {
  ?player rdf:type fb:american_football.football_player .
  ?player fb:people.person.place_of_birth ?birthplace .
  ?birthplace rdfs:label ?birthplaceName .
  ?player rdfs:label ?playerName .
