PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX fb: <http://rdf.freebase.com/ns/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
SELECT DISTINCT ?person ?personLabel ?office ?from ?to WHERE {
  {
    ?pos fb:type.object.type fb:government.government_position_held .
    ?pos fb:government.government_position_held.office_holder ?person .
    ?pos fb:government.government_position_held.office_position_or_title fb:m.060d2 .
    ?pos fb:government.government_position_held.from ?from .
    ?pos fb:government.government_position_held.to ?to .
    FILTER ( ?from <= "1945-09-02" ^^ xsd:date && ?to >= "1939-09-01" ^^ xsd:date ) .
    BIND( "President" AS ?office )
  } UNION {
    ?pos fb:type.object.type fb:government.government_position_held .
    ?pos fb:government.government_position_held.office_holder ?person .
    ?pos fb:government.government_position_held.office_position_or_title fb:m.0cgqx .
    ?pos fb:government.government_position_held.from ?from .
    ?pos fb:government.government_position_held.to ?to .
    FILTER ( ?from <= "1945-09-02" ^^ xsd:date && ?to >= "1939-09-01" ^^ xsd:date ) .
    BIND( "Speaker" AS ?office )
  }
  OPTIONAL {
    ?person rdfs:label ?personLabel FILTER ( lang( ?personLabel ) = "en" )
  }
}
ORDER BY ?office ?from

